import React, { Component } from "react";

class HeaderComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div>
        <nav>
          <div>
            <a href="http://frankuzoka.com" className="navbar-brand">
              Employee Management App
            </a>
          </div>
        </nav>
      </div>
    );
  }
}

export default HeaderComponent;
